import React, { Component } from 'react'
import { countryModule } from './../../../../api/country'
import TopNav from '../../../navbar/Topnav';
import Sidebar from '../../../navbar/SideNav';


class Country extends Component {
constructor(props) {
    super(props)

    this.state = {
        country:"" 
    }
}

async componentWillMount(){

    const countryList = await countryModule.getCountry();
    this.setState({country:countryList})
}


    render() {
        const country = this.state.country
        console.log("1")

        if(!Object.keys(country).length){
            return (<div><p>No Data Available</p></div>);
        }
        return (
            <div>
                <TopNav/>
                <Sidebar/>
                <table className ="table table-bordered  table-hover">
                <thead className ="black white-text">
            <tr>
              <th>Country Name</th>
              <th>Status</th>
            </tr>
          </thead>
                {
                    
                    country.map((prsn , index) => {
                        return (
                            <tbody key = {prsn.id} className = {prsn.id}>
                              <tr >
                                <td>{prsn.country_name}</td>
                                <td>{prsn.is_active}</td>
                              </tr>
                            </tbody>
                            );
                        
                    })


                }

          </table>
            </div>
        )
    }
}

export default Country
